import React, {useState} from 'react'

function SearchResults() {

    function ResultFunction() {

        const songs = [
            {'title': 'song 1',
            'artist': 'artist 1',
            'album': 'album 1'
            },
            {'title': 'song 2',
            'artist': 'artist 2',
            'album': 'album 2'
            },
            {'title': 'song 3',
            'artist': 'artist 3',
            'album': 'album 3'
            },
            {'title': 'song 4',
            'artist': 'artist 4',
            'album': 'album 4'
            },
        ]

        const arraySongItems = songs.map((song) => <li>{song} test</li>)

        return (
        <ul>
            {arraySongItems}
        </ul>
        )
    }

    return(
        <>
            <h2>Search Results</h2>
            <ResultFunction />
        </>
    )
}

export default SearchResults;
